  margin: 10em auto;
  text-align: center;
`;
const ThankYou = props => (
  <Message>
    <h1>Thank you for your gift to Free Spirits.</h1>
    <h1>
      You will receive an email soon.<Link href="/">Back to Homepagex</Link>{" "}
    </h1>
  </Message>
);

export default ThankYou;
